(350, 'Dependencia – Código de practica', 'Solo se acepta dependencia para los códigos de prácticas: 1 a 12, 37 a 48, 58 a 72, 76 a 78, 82 a 84 y 96', 'Verificar si corresponde dependencia'),
(351, 'Periodo de prestación – Fecha de emisión del comprobante', 'Mes y año de la fecha de emisión del comprobante debe ser mayor o igual al periodo de prestación', 'Corroborar que la fecha de emisión sea mayor o igual al periodo de prestación'),
(353, 'CUIL – Código de practica – CUIT – Tipo de comprobante – Punto de venta – Numero de comprobante', 'No se permitirán registros duplicados para igual CUIL, igual CÓDIGO DE PRACTICA, igual CUIT, igual TIPO DE COMPROBANTE, igual PUNTO DE VENTA, igual NÚMERO DE COMPROBANTE. Solo se aceptara un registro y se rechazaran los duplicados.', 'Verificar duplicidad de registros'),
(354, 'Tipo archivo – Código de ,practica', 'Para registros DC y DB no se aceptan los códigos de prácticas 97-98-99', 'Verificar registro informado'),
(400, 'CUIL – RNOS – Tipo de beneficiario', 'El CUIL debe existir en el padrón de la Obra Social, y no debe ser del tipo beneficiario adherente (tipo de beneficiario 03)', 'Verificar si el CUIL existe en el padrón y tipo de beneficiario'),
(403, 'CUIT', 'El CUIT debe existir en el Universo de CUIT', 'Verificar CUIT'),
(404, 'Código de practica – Cantidad', 'La cantidad informada para el código de práctica no corresponde', 'Verificar cantidad según los valores permitidos para cada unidad de medida'),
(405, 'Dependencia – Código de practica', 'El código de practica informado no puede tener dependencia', 'Verificar si corresponde dependencia'),
(406, 'CUIL – Periodo de prestación – Código de practica', 'Si se solicita el modulo “Apoyo a la integración escolar” (código 089) no se podrán solicitar para igual CUIL, igual PERIODO, los módulos de “Escolaridad” (códigos 025 a 036). En este caso se aplicara la prioridad a los registros que informen módulo “Apoyo a la integración escolar” y se rechazaran los registros de los módulos de “Escolaridad”.', 'Verificar códigos de prácticas para igual CUIL igual periodo de prestación'),
(407, 'CUIL – Periodo de prestación – Código de practica', 'Si se solicita el modulo “Prestaciones de apoyo” (código 086) no se podrán solicitar para igual CUIL, igual PERIODO los módulos de “Rehabilitación” (códigos 090 y 091). En este caso se aplicara la prioridad a los módulos de “Rehabilitación” y se rechazaran los registros del módulo de “Prestaciones de apoyo”.', 'Verificar códigos de prácticas para igual CUIL igual periodo de prestación'),
(408, 'CUIL – Periodo de prestación – Código de practica', 'Para solicitar el modulo “Prestaciones de apoyo” (código 086) se deberá solicitar para igual CUIL, igual PERIODO, como mínimo 1 (una) PRACTICA PRINCIPAL', 'Verificar códigos de prácticas para igual CUIL igual periodo de prestación'),
(409, 'CUIL – Periodo de prestación – Código de practica', 'Si se solicita el módulo de “Alimentación” (código 095) no podrá solicitarse los códigos de prácticas: (001 a 003, 007 a 009, 013 a 015, 019 a 021, 025 a 027, 031 a 033, 037 a 091, 093, 094 y 096)', 'Verificar códigos de prácticas para igual CUIL igual periodo de prestación'),
(411, 'CUIT – Tipo de comprobante – Punto de venta – Numero de comprobante', 'El comprobante se encuentra duplicado o presentado a través del Sistema Único de Reintegros.', 'Verificar registro informado'),
